/* eslint-disable react/prop-types */
import React from 'react';
import { Container } from 'styled-container-component';

const Layout = props => {
	return (
		<Container fluid>
			<div>
				<p>Top Stories</p>
				{props.children}
			</div>
		</Container>
	);
};

export default Layout;
